import React, { Component } from 'react';
import {data} from './columns';

const BaseTable = ({album, year, post}) => {
  return (
    <table>
      <tbody>
        <tr>
          <td>
            <h5>{album}</h5>
          </td>
          <td>
            <h5>{year}</h5>
          </td>
          <td>
            <h4>{post}</h4>
          </td>
        </tr>
      </tbody>
    </table>
  );
}
const HomePageHeader = () => {
  return (
    <header className="header">
      <h2>Your Stock Tracker</h2>
    </header>
  );
};
const Table = () => {
  return (
    <>
      <div className="stock-container">
        <HomePageHeader />
        {data.map((data, key) => {
          return (
            <div key={key}>
              <BaseTable
                key={key}
                album={data.album}
                year={data.year}
                post={data.US_peak_chart_post}
              />
            </div>
          );
        })}
      </div>
    </>
  );
};
export default Table;
